import React from "react";
import Weather from "../components/weather";

const ItemCardPage = () => {
    return (
        <>
            <div className="row">
                <div className="col-sm-6">
                    <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">Город</h5>
                        <p className="card-text">Прогноз погоды</p>
                        <a href="#" className="btn btn-secondary">Добавить в избранное</a>
                    </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default ItemCardPage;
